import React, { Component } from "react";
import { View,Text,Image } from "react-native";



export default class Main extends Component{




    render(){
        return(

            <View style={{
                flexDirection:"row",
                height:"100%"
            }}>
                <View style ={{
                    width:"18%",
                    height:"100%",
                    backgroundColor:"#FF6E70",

                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606"}}>
                        <View style={{height:120,width:280,marginLeft:35,backgroundColor:"transparent",shadowRadius:8}}>
                            <Image source={require('./images/MAAN_INSTITUTE_OF_MANAGEMENT_AND_SCIENCE_a-removebg-preview.png')}
                            style={{
                                width:"100%",
                                height:"100%",
                                resizeMode:"contain"
                            }}
                            ></Image>
                        </View>

                    </View>
                </View>
                <View style={{
                    width:"82%",
                    height:"100%",
                    backgroundColor:"#ffffff",
                    flexDirection:"column"
                }}>
                    <View style={{width:"100%",height:"5%",backgroundColor:"#880606",justifyContent:"center",alignContent:"flex-start",alignItems:"flex-start"}}>
                    <Text style={{fontFamily:"YanoneKaffeesatz",fontWeight:"600",alignSelf:"center",color:"#ffffff",fontSize:22}}>WWW.EMAAN.EDU.PK</Text>

                     </View>
                </View>


            </View>
        );
    }

}
